import ReactDOM from "react-dom";
import youTuber from "./App";
import {favourtthing, name, anotherName} from "App";

ReactDOM.render(
  <>
    <ol>
      <li>Roheel</li>
   //   <li>Roheel</li>
      <li>{favourtthing}</li>
      <li>{name()}</li>
      <li>{anotherName()}</li>
    </ol>
  </>,
document.getElementById('root'));
